@schiaparelli thanks for having us at the Black Dahlia Lloyd Wright House. 👁️ 🖤 💍 
From 1945 through 1950, the house was owned by Dr. George Hodel (https://en.m.wikipedia.org/wiki/George_Hodel),[2] a Los Angeles physician who was a prime suspect in the infamous Black Dahlia (https://en.m.wikipedia.org/wiki/Black_Dahlia) murder, although he was not publicly named as such at the time. The doctor’s own son, Steve Hodel, himself a retired City of Los Angeles homicide detective, argued in his 2003 book, Black Dahlia Avenger, that the Black Dahlia victim, Elizabeth Short, was actually tortured, murdered and dissected by his father in the basement of the Sowden House, in January 1947.[10] Hodel also claims that his father may have committed further murders in the house and buried victims in the basement or yard, before fleeing the country in 1950.[10] Despite claims that cadaver dogs (https://en.m.wikipedia.org/wiki/Cadaver_dogs)
 have indicated the presence of human remains on the property, no excavations have been made as of October 2015
